import React from 'react'
import { NavLink } from 'react-router-dom'
import SearchBar from '../SearchBar'
import './NavBar.css'

const NavBar = ({ onSearch, randomCharacter, logout }) => {
    return (
        // <nav className='navbar'>
        //     <div className='navbar-container'>
        //         <div className='navbar-logo'>
        //             <h1 className='rick-and-morty'>Rick and morty</h1>
        //         </div>
        //     </div>
        //     <div className='navbar-links'>
        //         <NavLink className={`navlink ${({isActive}) => isActive ? 'active' : 'disabled'}`} to='/home'>Home</NavLink>
        //         <NavLink className={`navlink ${({isActive}) => isActive ? 'active' : 'disabled'}`} to='/about'>About</NavLink>
        //         <SearchBar onSearch={onSearch} randomCharacter={randomCharacter} />
        //         <button className='logout-button' onClick={logout}><i class="fa fa-sign-out" style={{fontSize : '26px'}}></i></button>
        //     </div>
        // </nav>
        <nav className='navbar navbar-expand-lg navbar-dark bg-dark'>
            <div className='navbar-container'>
                <div className='navbar-logo'>
                    <h1 className='rick-and-morty'>Rick and Morty</h1>
                </div>
                <button className='navbar-toggler' type='button' data-toggle='collapse' data-target='#navbarLinks' aria-controls='navbarLinks' aria-expanded='false' aria-label='Toggle navigation'>
                    <span className='navbar-toggler-icon'></span>
                </button>
                <div className='collapse navbar-collapse justify-content-end' id='navbarLinks'>
                    <ul className='navbar-nav'>
                        <li className='nav-item'>
                            <NavLink className={`nav-link ${({ isActive }) => isActive ? 'active' : 'disabled'}`} to='/home'>Home</NavLink>
                        </li>
                        <li className='nav-item'>
                            <NavLink className={`nav-link ${({ isActive }) => isActive ? 'active' : 'disabled'}`} to='/about'>About</NavLink>
                        </li>
                    </ul>
                    <div className='navbar-nav ml-auto'>
                        <div className='searchBar'>
                            <SearchBar onSearch={onSearch} randomCharacter={randomCharacter} />
                        </div>
                        <button className='logout-button' onClick={logout}><i className='fa fa-sign-out' style={{ fontSize: '26px' }}></i></button>
                    </div>
                </div>
            </div>
        </nav>


    )
}

export default NavBar
